import React from 'react';
import JermaLogo from '../jerma-logo-shadow.webp';

const TopBar = () => {
    return <div className="top-bar">
        <div className="top-bar-logo-container">
            <img className="top-bar-logo" src="./" alt="logo"/>
        </div>
    </div>
}

export default TopBar;
